import axios from 'axios';
import { API } from '../Constants';

export function CheckAuth(name,
  password,
  setAuth,
  setNameError, setServerError) {

  axios({
    method: 'POST',
    baseURL: API + 'signin',
    data: {
      name: name,
      password: password
    }
  }).then((data) => {
    if (data.status === 203) {
      setNameError(true);
    } else {
      setAuth(data.headers.authorization);
    }
  }).catch((err) => {
    console.log(err);
    setServerError(true);
  })
}

export function Rsvp(rsvp) {

  axios({
    method: 'POST',
    baseURL: API + 'rsvp',
    data: {
      name: rsvp.name,
      response: rsvp.response,
      text: rsvp.text,
      email: rsvp.email
    }
  }).catch((err) => {
    setServerError(true);
  })
}

